// StartPage.js

import React from 'react';
import './StartPage.css'; // Import your CSS file for styling

const StartPage = () => {
  return (
    <div>
      <header>
        <img src="logo.png" alt="Logo" />

      </header>

      <section className="side-by-side-sections">
        <div className="left-section">
        <h1>Personal Budget App</h1>
    <p>A personal-budget management app</p>
          {/* Add any additional content for the left section here */}
        </div>
        <div className="right-section">
        <img src="logo.png" alt="Logo" />

        </div>
      </section>
      <section>
        <h1>Welcome to Our Website</h1>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit...</p>
        {/* Add your page content here */}
      </section>
    </div>
  );
}

export default StartPage;
